import axios from '@/axios';
export default {
  data() {
    return {
      user: {}
    };
  },
  methods: {
    async logout() {
      try {
        const user = await axios.get("/user", {
          headers: {
            'Authorization': `Bearer ${localStorage.getItem('token')}`
          }
        });
        const response = await axios.post("/logout", {
          headers: {
            'Authorization': `Bearer ${localStorage.getItem('token')}`
          },
          user: user
        });
        console.log(response);
